import React, { Fragment } from 'react';
import '../../../components/styles/Demo.css';
import Tabs from '../../../tabs/Tabs.js';
import {Link} from 'react-router-dom';
import Fade from 'react-reveal/Fade';
import Quiz from '../../../components/quiz/Quiz.js';
import fire from '../../../config/Fire';
import Login from '../../../components/Login.js';

class Unit14Lesson4 extends React.Component {
    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
        this.state = ({
            user: null,
          });
          this.authListener = this.authListener.bind(this);
    }
    logout(){
        fire.auth().signOut();
    }
    componentDidMount(){
        this.authListener();
      }

      authListener() {
        fire.auth().onAuthStateChanged((user) => {
      //login
          if (user) {
            this.setState({user});
            localStorage.setItem('user', user.uid);
          } 
      //logout
          else {
            this.setState({ user:null});
            localStorage.removeItem('user');
          }
        });
      }
    render() {
        return (
            <div>
                {this.state.user ? (<Lesson />) : (<Login />)}
            </div>
        )
      }
}
class Lesson extends React.Component {
    render() {
        return (
            <div class = "container">
                <div class = "split left">
                    <div class = "lesson_video">
                        <iframe src="https://www.youtube.com/embed/hDpmCXihL3s?rel=0" title="Video" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen="true"></iframe>
                    </div> 
                </div>
                <div class = "split right">
                    <div class = "lesson_content">
                        <div class = "lesson_title grow">Advanced Dictionaries</div>
                        <div class = "tabs">
                            <Tabs>
                                <div class="tab_label" label="Supplemental">
                                    <div class="tab_header">Advanced Dictionaries</div>
                                    <div class="paragraph">Unlike some of the other Data Structures we've worked with, most of the really useful methods available to us in Dictionaries have already been explored throughout this course. Here we will touch on just a few more for good measure.</div>
                                    <div class="tab_header">Dictionary Comprehensions</div>
                                    <div class="paragraph">Just like List Comprehensions, Dictionary Data Types also support their own version of comprehension for quick creation. It is not as commonly used as List Comprehensions, but the syntax is:</div>
                                    <div class="code_block">
                                        <div class="input">
                                            <div class="multi">dict = {`{`}x:x**2 <div class="blue">for</div> x <div class="blue">in</div> <div class="gre">range</div>(10){`}`}</div>
                                            <div class="multi"><div class="purp">print</div>(dict)</div>
                                        </div>
                                        <div class="output">
                                            <div>{`{0: 0, 1: 1, 2: 4, 3: 9, 4: 16, 5: 25, 6: 36, 7: 49, 8: 64, 9: 81}`}</div>
                                        </div>
                                    </div>
                                    <div class="paragraph">One of the reasons it is not as common is that the difficulty in structuring key names is not based on the values.</div>
                                    <div class="tab_header">Iteration over keys, values, and items</div>
                                    <div class="paragraph">Dictionaries can be iterated over using the keys(), values() and items() methods. For example:</div>
                                    <div class="code_block">
                                        <div class="input">
                                            <div class="multi">d = {`{`}<div class='str'>'k1'</div>:1,<div class='str'>'k2'</div>:2{`}`}</div>
                                            <br></br>
                                            <div class="multi"><div class="purp">print</div>(<div class='str'>'Print keys:'</div>)</div>
                                            <div class='multi'><div class="blue">for</div> k <div class="blue">in</div> d.keys():</div>
                                            <div class="multi in_1"><div class="purp">print</div>(k)</div>
                                            <br></br>
                                            <div class="multi"><div class="purp">print</div>(<div class='str'>'Print values:'</div>)</div>
                                            <div class='multi'><div class="blue">for</div> v <div class="blue">in</div> d.values():</div>
                                            <div class="multi in_1"><div class="purp">print</div>(v)</div>
                                            <br></br>
                                            <div class="multi"><div class="purp">print</div>(<div class='str'>'Print items:'</div>)</div>
                                            <div class='multi'><div class="blue">for</div> item <div class="blue">in</div> d.items():</div>
                                            <div class="multi in_1"><div class="purp">print</div>(item)</div>
                                        </div>
                                        <div class="output">
                                            <div>Print keys:</div>
                                            <div>k1</div>
                                            <div>k2</div>
                                            <div>Print values:</div>
                                            <div>1</div>
                                            <div>2</div>
                                            <div>Print items:</div>
                                            <div>('k1', 1)</div>
                                            <div>('k2', 2)</div>
                                        </div>
                                    </div>
                                    <div class="tab_header">Viewing keys, values and items</div>
                                    <div class="paragraph">By themselves the keys(), values() and items() methods return a dictionary view object. This is not a separate list of items. Instead, the view is always tied to the original dictionary.</div>
                                    <div class="code_block">
                                        <div class="input">
                                            <div class="multi">d = {`{`}<div class='str'>'k1'</div>:1,<div class='str'>'k2'</div>:2{`}`}</div>
                                            <div>key_view = d.keys()</div>
                                            <div class="multi"><div class="purp">print</div>(key_view)</div>
                                            <div class='multi'>d[<div class='str'>'k3'</div>] = 3</div>
                                            <div class="multi"><div class="purp">print</div>(d)</div>
                                            <div class="multi"><div class="purp">print</div>(key_view)</div>
                                        </div>
                                        <div class="output">
                                            <div>dict_keys(['k1', 'k2'])</div>
                                            <div>{`{'k1': 1, 'k2': 2, 'k3': 3}`}</div>
                                            <div>dict_keys(['k1', 'k2', 'k3'])</div>
                                        </div>
                                    </div>
                                    <div class="paragraph">Great! You should now feel very comfortable using the variety of methods available to you in Dictionaries!</div>

                                </div>
                                <div class="tab_label" label="Quiz">
                                <Fragment>
                                    <Quiz 
                                        quizdata={
                                            {
                                              question: "When ReactJS released?",
                                              FindAnswer:["JUN 2015", "March 2014", "March 2013", "bruh"], 
                                              rightAnswer:"March 2013"
                                            }
                                        }
                                    />
                                    <Quiz 
                                        quizdata={
                                            {
                                                question: "In which lifecycle event do you make AJAX requests and why?",
                                                FindAnswer:[ "componentWillMount", "componentDidMount", "use function", "bruh"], 
                                                rightAnswer:"componentDidMount"
                                            }
                                        }
                                    />
                                    <Quiz 
                                        quizdata={
                                            {
                                                question: "Moke",
                                                FindAnswer:[ "componentWillMount", "componentDidMount", "use function", "bruh"], 
                                                rightAnswer:"componentDidMount"
                                            }
                                        }
                                    />
                                </Fragment> 
                                </div>
                                <div class="tab_label" label="Assignment">
                                    <iframe height="400px" width="100%" src="https://repl.it/@SursumEducation/Unit14Lesson4?lite=true" title="Code" scrolling="no" frameborder="no" allowtransparency="true" allowfullscreen="true" sandbox="allow-forms allow-pointer-lock allow-popups allow-same-origin allow-scripts allow-modals"></iframe>
                                </div>
                            </Tabs>
                        </div>
                    </div>
                </div>

                <div class = "bottom_section">
                    <Fade bottom><div><div class ="lesson_backbutton"><Link to='/Python'><button class="grow">View Other Lessons</button></Link></div></div></Fade>
                </div> 

            </div>
        )
      }
}

export default Unit14Lesson4;
